class Solution:
    # @param s, an input string
    # @param p, a pattern string
    # @return a boolean
    def isMatch(self, s, p):
    	starAvailable = False
    	i = 0
    	j = 0
    	while i < len(s):
    		if j < len(p) and ( p[j] == '?' or s[i] == p[j] ):
    			i += 1
    			j += 1
    		else:
    			if j < len(p) and p[j] == '*':
    				starAvailable = True
    				while j < len(p) and p[j] == '*':
    					j += 1
    				if j == len(p):
    					return True
    				previousS = i
    				previousP = j
    			elif starAvailable:
    				previousS += 1
    				i = previousS
    				j = previousP
    			else:
    				return False

    	while j < len(p) and p[j] == '*':
    		j += 1
    	return j == len(p)





